import Image from './Image'


const Result = (props) =>{
    return(
        <div className='result' >
            <div className='image-container'>
        {console.log(props.images)}
        {
            props.images.map((image) =>(

               <Image key={image.recipe.label} image={image.recipe.image}/>
            ))
        }

        </div>
        </div>
    )
}

export default Result
